import React from 'react';
import {connect} from "react-redux";

import {LinkContainer} from "react-router-bootstrap";
import {Navbar, Nav, NavItem,Button,Alert} from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';


const NavBarButtons = () => {
    return (
        <div>
            <Navbar>
                <Navbar.Brand>
                    <a href="#">pp</a>
                </Navbar.Brand>
                <Navbar.Toggle/>
                <Navbar.Collapse>
                    <Nav >
                        <LinkContainer to={'#'}>
                            <NavItem>
                                <Alert color={'primary'}>this is primarty</Alert>
                               <Button color="danger">Sign Up</Button>
                            </NavItem>
                        </LinkContainer>

                    </Nav>
                </Navbar.Collapse>
            </Navbar>


        </div>
    );
};

export default connect()(NavBarButtons);
